import { http } from './index';

export const postCredit = (data) => {
    http.post("credit", data)
        .then((res) => {
            console.log(res.data)
        })
        .catch(err => {
            console.log(err)
        })
}

export const getCredit = () => {
    let data = [];
    http.get("credit")
        .then(res => {
            console.log(res.data)  
            data = res.data            
        })
        .catch(err => {
            console.log(err)
        })
    return data;    
}
